	@override String get transcoding_max_bitrate => 'Débit binaire maximal';
	@override String get transcoding_max_bitrate_description => 'Définir un débit binaire maximal peut résulter en des fichiers de taille plus prédictible, au prix d\'une légère perte en qualité. En 720p, les valeurs sont 2600k pour du VP9 ou du HEVC ou 4500k pour du H.264. Désactivé si le débit binaire est à 0.';
