	@override String get transcoding_target_resolution => 'Résolution cible';
	@override String get transcoding_target_resolution_description => 'Des résolutions plus élevées peuvent préserver plus de détails, mais prennent plus de temps à encoder, ont de plus grandes tailles de fichiers, et peuvent réduire la réactivité de l\'application.';
	@override String get transcoding_temporal_aq => 'AQ temporelle';
