	@override String get transcoding_tone_mapping_npl => 'Mappage tonal NPL';
	@override String get transcoding_tone_mapping_npl_description => 'Les couleurs seront ajustées pour paraître normales sur un écran de cette luminosité. De manière contre-intuitive, des valeurs plus basses augmentent la luminosité de la vidéo et vice versa, car cela compense la luminosité de l\'écran. 0 configure cette valeur automatiquement.';
